import React from "react";
import {
  Container,
  Flex,
  FlexItem,
  FlexCentered
} from "../styles/general/General.styled";
import { SignUpImage } from "../styles/SignInOut.styled";
import Navbar from "./general/Navbar";
import { useFormik } from "formik";
import FormikTextField from "../../utils/FormikTextField";

const SignInOut = () => {
  const formik = useFormik({
    initialValues: {
      firstName: "",
      lastName: "",
      email: ""
    },
    onSubmit: values => {
      alert(JSON.stringify(values, null, 2));
    }
  });

  return (
    <>
      <Navbar />
      <Container
        p="10rem 4rem"
        mh="100vh"
        bgColor="rgba(224, 247, 250, 0.8)"
        h="60%">
        <Flex bgColor="#f3e5f5" h="60vh" br="6rem">
          <FlexItem fg="1" h="60vh">
            <SignUpImage />
          </FlexItem>
          <FlexItem w="75%">
            <FlexCentered>
              <form onSubmit={formik.handleSubmit}>
                <FlexCentered>
                  <label htmlFor="firstName">First Name</label>
                  <FormikTextField
                    id="firstName"
                    name="firstName"
                    type="text"
                    onChange={formik.handleChange}
                    value={formik.values.firstName}
                  />
                  <label htmlFor="lastName">Last Name</label>
                  <FormikTextField
                    id="lastName"
                    name="lastName"
                    type="text"
                    onChange={formik.handleChange}
                    value={formik.values.lastName}
                  />
                  <label htmlFor="email">Email Address</label>
                  <FormikTextField
                    id="email"
                    name="email"
                    type="email"
                    onChange={formik.handleChange}
                    value={formik.values.email}
                  />
                  <button type="submit">Submit</button>
                </FlexCentered>
              </form>
            </FlexCentered>
          </FlexItem>
        </Flex>
      </Container>
    </>
  );
};

export default SignInOut;
